Продам автомобиль Форд Фокус 3 поколения.

Первая дата регистрации автомобиля: 13 мая 2015 года.


СОСТОЯНИЕ АВТОМОБИЛЯ:

Пробег на 14 декабря: 87300 км
Двигатель и коробка передач работают отлично;
Подвеска на отлично – без стуков и посторонних шумов;
Салон как в новом авто - без царапин, потертостей, пятен и тому подобное;
Лакокрасочное покрытие на хорошо. Все недочеты показаны на фото;
Оригинальное лобовое стекло без сколов и трещин;

В целом, автомобиль в очень хорошем техническом состоянии.
Своевременное обслуживание и бережное отношение.

ОБСЛУЖИВАНИЕ АВТОМОБИЛЯ:

В ноябре 2020 были заменены передние и задние тормозные диски и колодки.
Замена моторного масла и фильтров каждые 8000 км.
На 80000 км были заменены свечи зажигания.
На все виды работ есть документы.

ИСТОРИЯ АВТОМОБИЛЯ:

Первым владельцем автомобиля была банковская организация, водитель – девушка.
Автомобиль обслуживался у официального дилера, был застрахован в КАСКО.
Было незначительное ДТП (царапины и вмятости), по страховке была произведена замена поврежденных элементов. Вся информация есть в отчетах.
В июне 2019 года эта же девушка выкупает данный автомобиль в собственность, а в ноябре 2019 сдает в trade-in в обмен на новый авто.
С января 2020 года являюсь собственником.

Пробег автомобиля реальный. На всю историю пробегов есть документальные подтверждения.

КОМПЛЕКТАЦИЯ:

- Hands free;
- Bluetooth;
- Управление на руле;
- Подогрев передних сидений;
- Подогрев лобового стекла;
- и другие…

Готов на любые проверки и диагностику. За автомобиль не стыдно.
Продажа в связи с вложениями в бизнес.
